-- Table 1: Bank
CREATE TABLE Bank (
    BankID INT PRIMARY KEY,
    BankName VARCHAR(100),
    BranchCode VARCHAR(20),
    Address VARCHAR(200),
    City VARCHAR(50),
    IFSCCode VARCHAR(20));

-- Table 2: Employee
CREATE TABLE Employee (
    EmployeeID INT PRIMARY KEY,
    BankID INT,
    FullName VARCHAR(100),
    Position VARCHAR(50),
    Email VARCHAR(100),
    Phone VARCHAR(15),
    HireDate DATE,
    FOREIGN KEY (BankID) REFERENCES Bank(BankID));

-- Table 3: Customer
CREATE TABLE Customer (
    CustomerID INT PRIMARY KEY,
    FullName VARCHAR(100),
    DOB DATE,
    Address VARCHAR(200),
    City VARCHAR(50),
    Phone VARCHAR(15),
    Email VARCHAR(100),
    CreatedDate DATE);

-- Table 4: Transaction
CREATE TABLE Transaction (
    TransactionID INT PRIMARY KEY,
    CustomerID INT,
    TransactionType VARCHAR(20), -- e.g., Deposit, Withdrawal
    Amount DECIMAL(12,2),
    TransactionDate DATE,
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID));

-- Table 5: Account (Khata)
CREATE TABLE Account (
    AccountID INT PRIMARY KEY,
    CustomerID INT,
    BankID INT,
    AccountType VARCHAR(20), -- e.g., Savings, Current
    OpeningDate DATE,
    Balance DECIMAL(12,2),
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID),
    FOREIGN KEY (BankID) REFERENCES Bank(BankID));

-- Table 6: CustomerFeatures (like Insurance, Loan, FD)
CREATE TABLE CustomerFeature (
    FeatureID INT PRIMARY KEY,
    CustomerID INT,
    FeatureType VARCHAR(50), -- Insurance, Loan, FD, etc.
    Description TEXT,
    StartDate DATE,
    EndDate DATE,
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID));


